import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faDownload } from '@fortawesome/free-solid-svg-icons';
import workapi from './API/WorksApi.js';

function Howitworks() {

    const [workData, setWorkData] = useState(workapi);

    return (
        <>
            <section>
                <div className="work-container container">
                    <h1 className='main-heading text-center'>How Does It Works</h1>
                    <div className="row">
                        {workData.map((curElem) => {
                            return (
                                <>
                                    <div className="col-12 col-lg-4 text-center work-container-subdiv">
                                        <FontAwesomeIcon icon={faDownload} className="font-awesome-icon" />
                                        <h2>Download App</h2>
                                        <p className='main-hero-para'>Lorem ipsum dolor sit amet consectetur adipisicing elit. Doloremque provident, aliquid officiis atque ullam ex ducimus vel quos veniam laboriosam, saepe sint maiores unde aperiam!</p>
                                    </div>
                                </>
                            )
                        })
                        }
                    </div>
                </div>
            </section>
        </>
    )
}

export default Howitworks;
